import { createGlobalStyle } from "styled-components";

const Global = createGlobalStyle`

    *{
        margin: 0;
        padding:0;
    }
    body {
        font-familly: 'Poppins', Sans-Serif;
        background-color: #f2f2f2;
    }
`;

export default Global;
